Квартира сдаётся с Яндекс.Арендой, а значит всё для вас:   
- без залога   
- без единоразовой комиссии  
- с поддержкой от наших специалистов в процессе проживания. 

Мы можем показать вам квартиру онлайн  это так же детально, как вживую, только вы не тратите время на дорогу и запись возможна на ближайшее время.

Стильная, светлая, просторная квартира, в которой есть все необходимое для комфортной жизни и даже чуть больше. Интерьер придется по душе даже самому строгому критику, а окончательно поможет убедиться в правильности решения техническое оснащение. 
Основные достоинства:
	продуманные системы хранения (есть кладовка), зонирования пространства и освещения;
	единый стиль оформления во всех комнатах;
	большая застекленная лоджия;
	пол, покрытый паркетной доской;
	раздельный санузел с качественной сантехникой;
	двуспальная кровать;
	техника: газовая плита со встроенным духовым шкафом, вытяжка, стиральная машина, холодильник, кондиционер, микроволновая печь, утюг, мультиварка;
	комплект посуды;
	умный домофон;
	гладильная доска;
	окна выходят на улицу (северо-восток);
	чистая парадная с мусоропроводом;
	есть кабель и подключён провайдер, но жилец может подключить своего провайдера;
	открытый паркинг.

Дворовая территория обустроена, прекрасная транспортная доступность, развитая инфраструктура, хорошее освещение. Арендатор дополнительно оплачивает все КУ (зимой максимум 6000 руб., летом  около 3000 руб.). В пешей доступности метро и остановки общественного транспорта.

Предлагается замечательная, большая, светлая трехкомнатная квартира (по факту 4-х комнатная)  в  комфортном, кирпичном доме 2011 года постройки ЖК Дом у Ледового дворца. 

- дом находится в пяти минутах пешком от ст.м. Проспект Большевиков. Рядом с домом проходит большое количество общественного транспорта в любой район Санкт-Петербурга;
- через дорогу прекрасный Яблоновский сад, тренировочная база по хоккею СКА, Ледовый дворец;
- в шаговой доступности находятся четыре школы, девять детских садов, лицей, большое количество детских центров, фитнес центры, поликлиники;
- рядом гипермаркеты, кафе, бизнес-центры;
- выезд на КАД в пяти минутах, за 20 минут возможно доехать до центра города, аэропорта, вокзалов;

Квартира видовая, с уютным интерьером 106,9 кв.м. без учета площади двух лоджий. Расположена на 22 этаже. В парадной три скоростных лифта, на площадке 4 квартиры.

Гармоничная планировка: 
- кухня 13 кв.м. с выходом на застекленную лоджию; 
- просторная гостиная 18,7 кв.м.; 
- спальня  21 кв.м. с выходом на лоджию с панорамным остеклением, большой гардеробной;
- из комнаты 32 кв.м. сделаны две детских со своей гардеробной;
- два санузла 2,8; 4,8 кв.м., в каждом размещены бойлеры;
- просторная прихожая 14,4 кв.м. 
В квартире установлены 2 кондиционера.   
Большие окна на две стороны открывают прекрасный вид на город.

В ЖК находится подземный паркинг, в котором есть возможность приобрести у нас машино-место. При одновременной покупке квартиры и машиноместа, предоставляем хорошую скидку.

