Трехкомнатная квартира с ремонтом, мебелью и техникой в самом центре города - до метро Сенная площадь 5 минут пешком!
-	Дом прошел полный капитальный ремонт в 1975 году  перекрытия именно железобетонные!
-	В квартире всё сделано с душой для комфортной жизни - можно сразу заезжать, взяв с собой только легкие вещи;
-	Вся мебель и встроенная бытовая техника остаётся новому владельцу  Вам об этом можно будет не думать;
-	В большой кухне-гостиной вся семья сможет собираться за одним столом;
-	Просторный совмещенный санузел создает ощущение СПА-салона  действительно большая душевая кабина, качественная сантехника, теплый пол, чистота и приятное глазу сочетание цветов;
-	Дворик уютный, зеленый, при этом окна не упираются в окна соседей  в доме напротив всего два этажа и из наших окон открывается романтичный вид на соседские крыши; 
-	Кроме того, расположение квартиры внутри двора позволило без проблем установить кондиционер, обеспечив оптимальный микроклимат в спальне;
-	Закрытый двор обеспечивает тишину и безопасность, в том числе для Вашего автомобиля;
-	У нас один взрослый собственник, нет никаких обременений, стоимость в договоре указываем полную;
Запишитесь первыми на просмотр, я организую оперативный показ!

Сдаётся в аренду уютная однокомнатная квартира в Санкт-Петербурге!
Адрес: Красногвардейский район, Конторская ул., д.20
О районе:
- вокруг расположены детские сады, школы, продуктовые магазины, кафе и многое другое;
- до ближайших станций метро Новочеркасская, Ладожская 8 минут транспортом;
- ТК Охта Молл в шаговой доступности;
- набережная Невы в шаговой доступности;
- напротив дома находится парк;
О квартире:
- корпоративный монолитный дом с очень хорошими соседями, очень чистая парадная, пассажирский лифт, парковка во дворе свободная;
- в доме находится консьерж;
 - в квартире уже проведен wi-fi; Smart-ТВ;
- общая площадь 40 м.кв.;
- находится на 5 этаже 7-этажного дома; окна выходят на улицу, засчет застекленной лоджии в комнате не шумно;
- раздельный чистый с/у; душевая, кабина, в туалете установлена раковина и гигиенический душ;
- тёплые полы в ванной; прихожей, лоджии;
- качественный ремонт во всей квартире; гранитная плитка, мраморные подоконники и стоолешница в ванной; большой шкаф для одежды в спальной, встроенная гардеробная в прихожей;
- вся бытовая техника для комфортного проживания;
- встроенный холодильник, стиральная машина, электрическая варочная панель, духовой шкаф, вытяжка, пылесос, утюг, гладильная доска, два телевизора, посуда;
- просторная лоджия.
Звоните и записывайтесь на просмотр этой уютной квартиры!

