Пред вами уютная квартира с деревянными полами и приятным видом из окна. Здесь есть всё самое необходимое для жизни 1-4 человек. В квартире удобная планировка, помещения укомплектованы добротной мебелью.

Основные преимущества:
     косметический ремонт;
     окна во двор;
     раздельный санузел;
     тёплые полы;
     вместительные шкафы;
     диван и кровать;
     техническое оснащение: роутер, телевизор, бойлер, стиральная машина, холодильник, газовая плита и духовой шкаф, микроволновая печь;
     парковка во дворе.

Дом стоит в шаговой доступности от станции метро Проспект Большевиков. Рядом есть остановки автобусов и трамваев.

В соседних зданиях открыты детские сады и школы. Поблизости работает ТЦ, сетевые супермаркеты, кафе, аптека. В районе есть поликлиники для детей и взрослых.

За 10-15 минут можно дойти до расположенных на берегах реки Оккервиль Яблоновского сада или Парка Есенина.

Важно: арендатор самостоятельно оплачивает коммунальные услуги (воду и электричество  по счётчику).

Продаётся новая, теплая 2-х комнатная квартира, на первом этаже.

1. Технические данные объекта:

- кирпичный дом;
- изолированные комнаты, площадью 9 и 17 м2;
- кухня правильной формы, площадь 8 м2;
- высота потолков 2,5 м;
- санузел раздельный;
- квартира без отделки - сделана бетонная стяжка пола;
- есть подъемник для инвалидных колясок.

Окна маленькой комнаты и кухни расположены со стороны парадной,
а окна большой комнаты - во двор.

2. Окружающая инфраструктура:

- в шаговой доступности продуктовые магазины: Пятёрочка, Дикси, Магнит, К
- в соседнем дворе два новых детских сада N11 и N460, на 218 и 200 мест;
- общеобразовательная школа N460, на 1550 учащихся;
- детская игровая площадка.

3. Транспортная доступность:

- до СПб, м.Купчино - 15 минут;
- до СПб, м.Шушары - 12 минут;
- г.Пушкин - 15 минут.

