- 1 совершеннолетний собственник;
- документы готовы к сделке;
- принимаем любую форму оплаты.

Особенности объекта:

- городская прописка СПб;
- собственная, новая, газовая котельная;
- расположен в экологически чистом районе.

Записывайтесь на показ.

