Продается 3-х комнатная квартира площадью 85,2 кв. м. Квартира расположена на 5 этаже из 23.
	ПРЯМАЯ продажа;
	ОДИН взрослый собственник;
	Обременение СБЕРбанка (остаток по ипотеке 2 350 000);
	Любая форма оплаты;
	Торг.
Данная квартира - отличный вариант для людей, разделяющих семейные ценности.
Роскошная квартира имеет следующие характеристики:
	5-й этаж из 23;
	Большая мебелированная кухня 13,1 кв.м. с барной стойкой;
	Все комнаты изолированные (19,1 кв.м., 14,5 кв.м., 10,9 кв.м.);
	2 санузла;
	2 балкона;
	Окна на улицу и во двор;
	Холл 20 кв.м.;
	Бойлер в ванной комнате.
Квартира расположена в отдалении от лифтов и лестниц, что, несомненно, является плюсом. В квартире произведено дополнительное утепление и шумоизоляция, сделаны тёплые полы, в 2-х комнатах установлены кондиционеры. При ремонте использованы качественные материалы (паркетная доска, пробковое дерево, керамогранит). В сан узлах установлена премиальная сантехника Grohe и Jacob Delafon.
Дом 2005 года постройки, многоуровневый, в самой высокой части имеет 23 этажа. Дом является высотной доминантой района, имеет обустроенную территорию. В парадной имеется 4 лифта. Выход из парадной на улицу и во двор.
Дом расположен в уютном районе с развитой инфраструктурой. В радиусе 5 минут ходьбы расположены спортивная школа, общеобразовательная школа, бассейн. Продовольственный магазин находится прямо в доме. Огромный зеленый массив Ржевского лесопарка находится через дорогу от дома. 
Автомобилистов порадуют сразу 2 выезда на КАД в непосредственной близости от дома. На машине до центра города всего 30 мин.
До метро ходит скоростной трамвай, который никогда не стоит в пробках.
Вся мебель (за исключением детской комнаты и мягкой мебели из зала) и крупная бытовая техника остаются покупателям и входят в стоимость квартиры.
Звоните, ведь лучше места для семейной идиллии просто не найти!
При необходимости поможем вам с одобрением ипотеки!
